import { useAuth } from "../context/AuthContext.js";
import { useNavigate } from "react-router-dom";
function Nav() {
  const navigate = useNavigate();
  const { user, logout } = useAuth();
  const handleLogOut = () => {
    logout();
    navigate("/");
  };
  const handleHome = () =>{}
  navigate("/home")
  return (
    <>
      <header className="fixed top-0 h-[90px] w-full bg-black/40 z-10">
        <nav className="h-full">
          <div className="flex text-red-600 font-bold items-center justify-center h-full">
            <div className="flex items-center justify-between w-full px-28">
              <span className="text-3xl hover:cursor-pointer" onClick={handleHome}>PELISUNCP</span>
              <div className="flex gap-4 items-center text-white">
                <span>Bienvenido, {user?.name}</span>
                <span>
                  <button
                    className="bg-red-600 text-white px-6 py-1 rounded hover:bg-red-800"
                    onClick={handleLogOut}
                  >
                    SALIR
                  </button>
                </span>
              </div>
            </div>
          </div>
        </nav>
      </header>
    </>
  );
}

export default Nav;
